import logo from './logo.svg';
import './media-queries.css';

function Logo() {

  return (
<div className="logo-container">
<NavLink to="/home" src={logo} className="logo"></NavLink>
          <img src={logo} alt="Logo" className="logo" />
          <span className="logo-text">InvestrTies</span>
<NavLink to="/home" className="logo-text">InvestrTies</NavLink>
        </div>
  );
}
export default Logo;
